                "description": "<p>Facial scars are of various types. They can be caused by accidents, injuries, acne, burns, or even surgery. After a wound is healed, it will leave a scar. Environmental factors also contribute to scars and even hinder their process of healing. Unlike other body parts, we cannot always cover our face. Scars are telltale signs left behind by previous injury or disease. Some wear it as a badge of honour. But scars in general, and facial scars in particular, can pose a lot of problems for its bearer. These scars may fade over time but will never disappear and sometimes may become wider, darker, raised or even hypertrophic. In all such cases, their treatment is possible.</p><p>Following are the treatment modalities available for scar treatments:</p><ul> <li>Scar revision surgery</li> <li>Fraction CO2 laser</li> <li>RF needle</li> <li>Subcision and fat or fillers</li> <li>Micro fat and Nano fat injections</li> <li>PRP injections</li> <li>Nd YAG laser for pigmentation</li> <li>Silicone gel sheets and silicone gel ointments</li> <li>Pressure garments</li> </ul><p>All of these in different combinations are needed from time to time. We have all these treatment modalities available at our centre under the expert guidance of our plastic surgeon.</p>"
