                    + " <div class='clear-10'></div>"
                    + " <div class='des_qsn'>What is liquid rhinoplasty?</div>"
                    + " <p>When minimal changes to the shape of the nose are done through hyaluronic acid fillers, it is called “liquid rhinoplasty”. It is a temporary procedure that lasts for 10-18 months, and hyaluronic acid are injected using a syringe into your nose that give it the shape. Not all patients would benefit from this. Some problems of the nose can be corrected by surgery alone.</p>"
                    + " <div class='clear-10'></div>"
                    + " <div class='des_qsn'>Will Rhinoplasty leave any scars?</div>"
                    + " <p>While closed rhinoplasty will not leave any, open rhinoplasty may leave a light scar at the part where your nose called the columella. But it's not prominent and blends with the skin around the area such that the scar is hardly visible over time.</p>"
                    + " <div class='clear-10'></div>"
                    + " <div class='des_qsn'>How long will it take to show results?</div>"
                    + " <p>In surgery, results are obtained in the OT itself. But your dressing and a plaster will stay for 5 days. The swelling will start to decrease after 3 weeks. Full results are visible within 6-8 months and the results improve upto 1 year. The results usually last for the rest of your life.</p>"
                    + " <div class='clear-10'></div>"
                    + " <div class='des_qsn'>Can my nose be made like a particular celebritiy’s nose?</div>"
                    + " <p>No. Your nose, like any other part of your face, is unique to you. The changes to be made to your nose will have to be determined during a one-on-one consultation, taking into consideration the harmony of all the other aspects of your face, your desires, your culture and most importantly your safety.</p>"
                    + " <div class='clear-10'></div>"
                    + " <div class='des_qsn'>How long do the results last?</div>"
                    + " <p>The results of a surgical rhinoplasty last a lifetime. The liquid rhinoplasty results last anywhere between 10-18 months.</p>"
                    + " <div class='clear-10'></div>"
