                "title": "Hair Transplantation",
                "description": "<p>While we concentrate more on facial appearance and looks, a good hairline adds to the overall effect. With age or other genetic or medical reasons, one tends to lose their hair which results in gradual balding and a receding hairline. It is more common in men than women. Hair transplantation is a surgical technique in which hair from other parts of one's head(donor site) is transplanted on the balding site on the body (recipient site). Hair transplants are commonly used to treat male pattern baldness. It is a minimally invasive procedure, in which grafts of hair are transplanted to the balding site. It is commonly done on scalp, but hair transplantation can also be done on eyebrows, eyelashes, beard hair, chest hair, pubic hair, etc. Sometimes they are also done to fill the scars caused by surgeries, accidents, etc.</p>"
