                "title": "Eyebrow Lift",
                "description": "<p>Also known as brow lift, this aesthetic procedure is done to give sagging eyebrows a lifted, more younger and a more attractive appearance. The process also improves the look of the area around the eyes. Browlift can be done as a stand-alone procedure or can be combined with an eyelid surgery (blepharoplasty) or a facelift. With age, the brows droop and the sagginess of the skin makes one look tired, sad, old, unattractive or angry. If you have sagging brows, they can contribute to making your eyes look tired too. These sagging brows may also cause your forehead muscles to work harder leading to forehead lines or wrinkles.</p><p>Many techniques are used by a plastic surgeon for lifting the brow. It may be done surgically or using non-surgical techniques such as a threadlift, Botox and Fillers. Surgically it maybe performed in a variety of ways which may be either endoscopic or open surgery.</p>"
