                    + "<p>The threads used are usually of a dissolvable material that dissolve over time. They are replaced with collagen -- the building blocks of the skin that become lesser with age. Good quality collagen being laid down over time offers better results. It is a fairly common process in younger patients, because there is not too much sagging or deep wrinkling of the skin.</p>"
