                    + "<div class='des_qsn'>At what age should one get a necklift done?</div>"
                    + "<p>(Those  between ages 45-50, or above. In younger patients, double chin is corrected with just a liposuction.) If your biological age is such that you can begin to see changes in the neck is the time when you come down to us for the neck rejuvenation procedures. When the problems are minor, small procedures such as non-surgical or minimally invasive ones such as liposuction may solve your problem. If your neck has major issues aesthetically, you may require a formal necklift surgery. However, this can be decided only after your consultation.</p>"
                    + "<div class='clear-10'></div>"
                    + "<div class='des_qsn'>Can a Facelift and Necklift be done together?</div>"
