                    + "<p class='des_tile'>Frequently Questions Asked</p>"
                    + "<div class='clear-10'></div>"
                    + " <div class='des_qsn'>Is ear lobe piercing repair a permanent procedure and how long does the surgery take?</div>"
                    + " <p>Holes due to piercing in the ear lobes often become elongated with time. This prevents the woman from wearing earrings. It can be corrected by a simple procedure under local anesthesia in half an hour and you can go back home immediately. No restrictions in activity are needed. Once closed the holes will be permanently closed with a minimal scar. After 10 days of surgery we will make a new hole as per your desires.</p>"
