                    + "<p>Breast augmentation procedures enhance the breasts. It is increasing the size of a woman’s bust and can be done in one of two ways – using implants or fat grafting. Silicone implants are more commonly used. In fat grafting, the fat is harvested from a woman's body such as lower abdomen or thighs, and grafted into the breasts.</p>"
