                    + "<div class='clear-10'></div>"
                    + "<div class='des_qsn'>How long would the recovery take?</div>"
                    + "<p>The recovery period is pretty short. The stitches are usually dissolvable stitches&nbsp; and they don&rsquo;t leave scars.</p>"
